import React from 'react';
const TodoItem = (props) => {
  const onCheck = () => {
    document.getElementById("myCheck").checked ? (<strike>{props.item.content}</strike>) : ( props.item.content)
  }
  return (
    <div>
      <input type='checkbox' id='myCheck' onClick={onCheck}/>
      <label id='content'>
      </label>
      <button type='button' onClick={()=>props.onSubmitDelete(props.item.id)}>Delete</button>
    </div>
  );
}
export default TodoItem;
